import React from 'react';
import brisbane from '../../resources/images/logos/brisbane.png'
import la from '../../resources/images/logos/la.png'
import paris from '../../resources/images/logos/paris.png'
import milano from '../../resources/images/logos/milano.png'





const olympicsGamesNext = () => {
    return (
        <div>

        <section id="next_olympics">
                <a class='nol' href="https://olympics.com/en/beijing-2022/schedule-by-sport/alpine-skiing/" target="_blank" > <img className='olicn' src={brisbane} ></img></a>   
                <a class='nol' href="https://olympics.com/en/beijing-2022/schedule-by-sport/biathlon/" target="_blank" > <img className='olicn' src={la} ></img></a>   
                <a class='nol' href="https://olympics.com/en/beijing-2022/schedule-by-sport/bobsleigh/" target="_blank" > <img  className='olicn' src={paris} ></img></a>                 
                <a class='nol' href="https://olympics.com/en/beijing-2022/schedule-by-sport/cross-country-skiing/" target="_blank" > <img className='olicn' src={milano}></img></a>
        </section>
        </div>
    )
};
export default olympicsGamesNext;
